import { StatusBar } from 'expo-status-bar';
import React, {useState, useEffect} from 'react';
import { StyleSheet, Text, View, ActivityIndicator, SafeAreaView, FlatList,Image, Dimensions } from 'react-native';
import {MaterialCommunityIcons} from "@expo/vector-icons"
export default function App() {

 return (
  <View style={styles.container}>
     <StatusBar backgroundColor={colors.background} barStyle="dark-content"/>
      <View
      style={{
        padding:16,
        flexDirection:"row",
        justifyContent:"space-between"
      }}
      >
        <View >
            <Text style={{fontSize:16}}>COVID-19</Text>
            <Text style={{fontsize:16}}>Việt Nam</Text>
        </View>
          <MaterialCommunityIcons
          name="thermometer"
          size={45}
          style={{color: colors.white, backgroundColor: colors.themeColor}}
          />
      </View>
      <View 
          style={{
            borderTopWidth:6,
            borderTopColor: colors.themeColor,
            borderRadius:3

          }}
      />

      <View style={styles.container}>
            <View
              style={{
                padding:16,
                flexDirection:"row",
                justifyContent:"space-between"
              }}
              >
            <View >
              <Text style={{fontSize:16}}>COVID-19</Text>
              <Text style={{fontsize:16}}>Thế giới</Text>
            </View>
            <MaterialCommunityIcons
              name="thermometer"
              size={45}
              style={{color: colors.white, backgroundColor: colors.themeColor}}
              />
              </View>
              <View 
                  style={{
                    borderTopWidth:6,
                    borderTopColor: colors.themeColor,
                    borderRadius:3

                  }}
              />

     </View>  
  </View>
  );
};


const colors={
  themeColor:"#ffc66a",
  white:"#fff",
  background:"#f4f6fc",
  greyish:"a5a5a5"
};



  const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: colors.background,
      paddingHorizontal:8

    }
  });
